import React from "react";


class Entries extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      debtInput: 0, //debtInput
      interest: 0, //interestInput
      newInterest: 0, // monthlyInterest
      debtDue: 0, // remainingDebt
      miniDue: 0, // minPay
      totalPaid: 0, //remainingPayment
    };
  }

  handleChange = (e) => {
    this.setState({ [`${e.target.name}`]: e.target.value });
  };

  dataFromInput = () => {
    const { debtInput, interest } = this.state;
    let debt = debtInput * 1;
    let monthlyIntPayment = (interest * debt) / 100 / 12;
    let minPayment = monthlyIntPayment + debt * 0.01; //minTotalPay
    let debtFree = minPayment + debt; //totalPayoff

    this.setState({
      newInterest: (interest * debtInput) / 100 / 12,
      debtDue: debt * 1,
      miniDue: minPayment,
      totalPaid: debt / minPayment,
    });

    this.props.dataFromInput(minPayment, debt, debtFree);
  };

  computeDebt = () => {
    if (this.state.debtDue > 100) {
      const { interest, debtDue } = this.state;
      const { payment } = this.props;

      let monthlyInt = interest / 100 / 12;
      let monthlyIntPay = monthlyInt * debtDue;
      let newMiniDue = monthlyIntPay + debtDue * 0.01;
      let principlePaid = payment - monthlyIntPay;
      let newDebt = debtDue - principlePaid;
      let debtFree = newMiniDue + newDebt;

      this.setState({
        newInterest: monthlyInt * debtDue,
        debtDue: newDebt * 1,
        miniDue: newMiniDue,
        totalPaid: newDebt / principlePaid,
      });

      this.props.dataFromInput(newMiniDue, newDebt, debtFree);
    } else {
      const { debtDue } = this.state;
      const { payment } = this.props;

      let newDebt = debtDue - payment;
      let newMiniDue = debtDue * 0.01 + newDebt;
      let totalPaid = debtDue * 0.01 + newDebt;

      this.state({
        debtDue: newDebt,
        miniDue: newMiniDue,
        totalPaid: newDebt / newMiniDue,
      });

      this.props.dataFromInput(newMiniDue, newDebt, totalPaid);
    }
  };

  resetTheCalculator = () => {
    this.setState({
      debtInput: 0, //debtInput
      interest: 0, //interestInput
      newInterest: 0, // monthlyInterest
      debtDue: 0, // remainingDebt
      miniDue: 0, // minPay
      totalPaid: 0,  // remainingPayments
    });
  };

  render() {

    const {debtInput, interest, debtDue, miniDue, totalPaid} = this.state

    const formData = [
      {header: 'Debt', label:`$${debtInput}`, name:'debtInput', type:'range', min:'1000', max:'200000',
      value:debtInput, step:'500', onChange:this.handleChange, className:'slider', id:'debtRange'},
      {header: 'Interest Per Year', label:`$${interest}%`, name:'interest', type:'range', min:'1', max:'30',
      value:interest, step:'0.1', onChange:this.handleChange, className:'slider', id:'InterestRange'}]
    return (
       <div>
        <div className="container entries">
          {formData.map((data) => 
          <div>
            <h3>{data.header}</h3>
            <div className='total'>{data.label}</div>
            <input
            name={data.name}
            type={data.type}
            min={data.min}
            max={data.max}
            value={data.value}
            step={data.step}
            onChange={data.onChange}
            className={data.className}
            id={data.id} />
          </div>
          )}
        <button className='button' onClick={this.dataFromInput}>Calculate</button>
        </div>
      <div className="info-container container">
        <div className="infos">
          <div>
            <h4>Debt Remaining: </h4>
            <div className="calc-text">The initial Debt minus Principal</div>
            <span className="mini-due">${debtDue.toFixed(2)}</span>
            <h4>Minimum Due: </h4>
            <div className="calc-text"> Should be Monthly Interest add to 1% of the debt or Principal</div>
            <div className="calc-text">Monthly Interest: ${this.state.newInterest.toFixed(2)}</div>
            <span className="miniDue">${miniDue.toFixed(2)}</span>
            <h5>Number Of Payments Left: </h5>
            <div className="calc-text">Based on your payment history</div>
            <span className="paid-left">{totalPaid.toFixed(1)}</span>
          </div>
        </div>
      </div>

       </div>
    )
  }
}

export default Entries;
